#include "sap.h"
#include <stddef.h>

/* Number of elements supported by the implementation + 1 */
#define SAP_NELEM 119
/* Radial points in the table */
#define SAP_NRAD 376
/* Use 5th order interpolation */
#define LIP_ORDER 5

static double lagrange_interpolation(const double *xi, const double *yi,
                                     double x, int N) {
  /* Lagrange polynomial */
  double li;
  /* Loop indices */
  int i, j;
  /* Result */
  double y;
  /* Loop over polynomials */
  y = 0.0;
  for (i = 0; i < N; i++) {
    /* Evaluate the polynomial */
    li = 1.0;
    for (j = 0; j < N; j++) {
      if (i == j)
        continue;
      li *= (x - xi[j]) / (xi[i] - xi[j]);
    }
    /* Increment function value */
    y += yi[i] * li;
  }
  return y;
}

static double array_lookup(const double array[SAP_NELEM][SAP_NRAD], int Z,
                           double x) {
  /* Table lookup helpers */
  size_t posleft, posright, posmiddle;
  /* Storage for data points */
  double xi[LIP_ORDER];
  double yi[LIP_ORDER];
  /* Loop index */
  int i;

  /* Sanity check nucleus */
  if (Z < 1)
    return 0.0;
  if (Z >= SAP_NELEM)
    return 0.0;
  /* Sanity check for radius */
  if (x <= 0.0)
    return array[Z][0];
  if (x >= array[0][SAP_NRAD - 1])
    return array[Z][SAP_NRAD - 1];

  /* Figure out where we are in the x array using a binary search */
  posleft = 0;
  posright = SAP_NRAD - 1;
  while (1) {
    posmiddle = (posleft + posright) / 2;
    if (array[0][posmiddle] < x)
      posleft = posmiddle;
    else if (array[0][posmiddle] > x)
      posright = posmiddle;
    else if (array[0][posmiddle] == x)
      return array[Z][posmiddle];

    if (posleft + 1 == posright)
      break;
  }

  /* Obtain result with a Lagrange interpolating polynomial.
     Do we have an array overrun? */
  if (posleft + LIP_ORDER - 1 >= SAP_NRAD)
    posleft -= (posleft + LIP_ORDER) - SAP_NRAD;

  /* Copy data */
  for (i = 0; i < LIP_ORDER; i++) {
    xi[i] = array[0][posleft + i];
    yi[i] = array[Z][posleft + i];
  }

  return lagrange_interpolation(xi, yi, x, LIP_ORDER);
}

